import TabControler from "component/admin/TabControler/TabControler";
import Back from "component/back/Back";
import { Input } from "component/inputs/Input";
import useValidationSchema from "hooks/useValidationSchema";
import i18next from "i18next";
import React from "react";
import { Field, Form } from "react-final-form";
import calckBlack from "./../../../../assets/preli/calcBlack.svg";
import calckBlue from "./../../../../assets/preli/calcBlue.svg";
import invoiceBlack from "./../../../../assets/preli/invoiceBlack.svg";
import invoiceBlue from "./../../../../assets/preli/invoiceBlue.svg";
import "./detailPreliquidation.scss";

const tabs = [
  {
    title: "Preliquidacion",
    id: "PRELI",
    icons: { active: calckBlue, disable: calckBlack },
  },
  {
    title: "Factura",
    id: "INVOICE",
    icons: { active: invoiceBlue, disable: invoiceBlack },
  },
];

export const DetailPreliquidation = ({
  isFetching,
  changePage,
  handleClickBack,
  initialValues,
  validationSchema,
}: any) => {
  return (
    <div>
      <Form
        onSubmit={(value) => value}
        initialValues={initialValues}
        mutators={{
          setValue: ([field, value], state, { changeValue }) => {
            delete value.label;
            changeValue(state, field, () => value);
          },
        }}
        validate={useValidationSchema(validationSchema)}
      >
        {({ invalid, handleSubmit, form, values, dirty }) => (
          <form className="form-filter-transaction" onSubmit={handleSubmit}>
            <div className="header-container">
              <TabControler
                tabs={tabs}
                changePage={() => {
                  changePage("INVOICE", dirty);
                }}
                actualPage={"PRELI"}
              />
              <Back onClick={() => handleClickBack(dirty)} />
            </div>
            <div className="mainContainerFlex">
              <h2 className="detail-preliquidation-h2">
                {i18next.t(
                  "detailPreliquidation:label.subtitle.preliquidationNumber"
                )}
              </h2>
              <p className="detail-preliquidation-number">{2201100002}</p>
            </div>
            <div className="display-filter-transaction">
              <div className="container-detail-preliquidation-test-row">
                <div className="form-filter-transaction">
                  <div className="container-detail-preliquidation-test-col-sm-1">
                    <Field
                      type="text"
                      name="emisionDate"
                      label="Estado"
                      component={Input}
                      className="Admin-Pickers-input"
                      placeholder={i18next.t(
                        "invoice:placeholder.form.broadcastDate"
                      )}
                      language="es"
                      disabled={true}
                    />
                  </div>
                  <div className="container-detail-preliquidation-test-col-sm-1">
                    <Field
                      type="text"
                      label="Fecha de emisión"
                      name="emisionDate"
                      component={Input}
                      className="Admin-Pickers-input"
                      placeholder={i18next.t(
                        "invoice:placeholder.form.broadcastDate"
                      )}
                      language="es"
                      disabled={true}
                    />
                  </div>
                  <div className="container-detail-preliquidation-test-col-sm-1">
                    <Field
                      type="text"
                      name="emisionDate"
                      label="Identificador fiscal"
                      component={Input}
                      className="Admin-Pickers-input"
                      placeholder={i18next.t(
                        "invoice:placeholder.form.broadcastDate"
                      )}
                      language="es"
                      disabled={true}
                    />
                  </div>
                  <div className="container-detail-preliquidation-test-col-sm-1">
                    <Field
                      type="text"
                      label="Razón social"
                      name="emisionDate"
                      component={Input}
                      className="Admin-Pickers-input"
                      placeholder={i18next.t(
                        "invoice:placeholder.form.broadcastDate"
                      )}
                      language="es"
                      disabled={true}
                    />
                  </div>
                  <div className="container-detail-preliquidation-test-col-sm-1">
                    <Field
                      type="text"
                      name="emisionDate"
                      label="Codigo SAP"
                      component={Input}
                      className="Admin-Pickers-input"
                      placeholder={i18next.t(
                        "invoice:placeholder.form.broadcastDate"
                      )}
                      language="es"
                      disabled={true}
                    />
                  </div>
                </div>
              </div>
            </div>


                <div className="container-detail-preliquidation-card-row">
                  <div className="container-detail-preliquidation-card-col-sm-1">
                    <h2>Historial</h2>
                  </div>
                  <div className="container-detail-preliquidation-card-col-sm-2">
                    <h2>Transacciones</h2>
                  </div>
                </div>


          </form>
        )}
      </Form>
    </div>
  );
};
